function init(){if(typeof show_count_chart==="undefined"){setTimeout(function(){init()},50)}else{show_count_chart()}}function get_chart_data(e){var t=[],n=[],r=[];for(key in e){t.push(key);n.push(e[key])}r.push(t);r.push(n);return r}function show_count_chart(){var e,t,n=null,r,i;e=get_chart_data(JSON.parse($("#all-pages").val()));t={labels:e[0],datasets:[{fillColor:"rgba(180,180,180,0.5)",strokeColor:"rgba(150,150,150,0.8)",data:e[1]}]};r=Math.max.apply(Math,e[1]);i={scaleOverride:true,scaleSteps:8,scaleStepWidth:Math.ceil(r/8),scaleStartValue:0,maintainAspectRatio:true};if(typeof Chart!=="undefined"){n=(new Chart($("#page_canvas")[0].getContext("2d"))).Bar(t,i);return n}else{setTimeout(function(){show_count_chart()},1e3)}}init()